import React, {Component} from 'react';


import logo from './logo.svg';
import './App.css';

class App extends Component{
    constructor(){
      super();

      this.state = {
        monsters: [
          {
            name: 'Frankestein',
            id: 'dscf2'
          },
          {
            name: 'Dracula',
            id: 'sdf32'
          },
          {
            name: 'Zombie',
            id: 'sdvv33'
          },
        ]
      }
  }
}

export default App;
